import React from 'react';

interface IState {
    username: string; 
    password: string;
    fname: string; 
    lname: string; 
    email: string; 
    phoneno: string;
}

export class RegistrationForm extends React.Component<{}, IState> {
    constructor(props: {}) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind(this);

        this.state = {
            username: "",
            password: "",
            fname: "",
            lname: "",
            email: "",
            phoneno: ""
        }
    }

    public handleSubmit(e: React.FormEvent<HTMLFormElement>): void {
        e.preventDefault();
    }

    public render(): JSX.Element {
        return <div>
                <form onSubmit={(e) => this.handleSubmit(e)} noValidate={true}>
                <div className="container">
                    <div className="form-group banner">
                        <h2>Register</h2>
                        <p>Username: <input type="text"></input></p>
                        <p>Password: <input type="password"></input></p>
                        <p>First name: <input type="text"></input> Last name: <input type="name"></input></p>
                        <p>Email address: <input type="text"></input></p>
                        <p>Phone number: <input type="string"></input></p>
                        <button className="btn-primary" type="submit">
                            Login
                        </button>
                    </div>
                </div>
            </form>
        </div>
    }
}

export default RegistrationForm;
